class Node_1268{
    char c;
    Node_1268[] children=new Node_1268[26];
    PriorityQueue<String> pq=new PriorityQueue<>((s1,s2)-> {
    	return s1.compareTo(s2);
    });
}

class TrieTree{
    Node_1268 root;
    public TrieTree(){
        root=new Node_1268();
    }

    public void insertAll(String[] products) {
    	for(String product:products){
            insert(product);
        }
    }
    
    public void insert(String word){
        Node_1268 p=root;
        for(int i=0;i<word.length();i++){
            char c=word.charAt(i);
            if(p.children[c-'a']==null){
                p.children[c-'a']=new Node_1268();
                p.children[c-'a'].c=c;
            }
            p=p.children[c-'a'];
           	p.pq.offer(word);
        }
    }
    
    public List<List<String>> searchWord(String searchWord) {
    	List<List<String>> res=new ArrayList<>();
    	Node_1268 p=root;
    	for(int i=0;i<searchWord.length();i++) {
    		char c=searchWord.charAt(i);
    		if(p==null||p.children[c-'a']==null) {
    			res.add(new ArrayList<String>());
    			if(p!=null)
    				p=p.children[c-'a'];
    		}else {
    			p=p.children[c-'a'];
    			List<String> list=new ArrayList<>();
    			for(int j=0;j<3;j++) {
    				if(!p.pq.isEmpty()) {
    					list.add(p.pq.poll());
    				}
    			}
    			res.add(list);
    		}
    	}
    	return res;
    }
}